import Card from "./Card";



function GridGeneral() {

  return (

        <Box p={6}>
          <SimpleGrid padding={'10px'}  spacing="30px" minChildWidth="300px">
          <Card></Card><Card></Card><Card></Card><Card></Card><Card></Card><Card></Card><Card></Card><Card></Card><Card></Card><Card></Card><Card></Card><Card></Card>
          </SimpleGrid>
        </Box>

  );
}

export default GridGeneral;
